import React from 'react';
import './Projects.css';

function Projects() {
    return (
        <div className="Projects">
            <h2>Projects</h2>
            <ul>
                <li>Project 1: Email sending application</li>
                <li>Project 2: Database Management System</li>
                <li>Project 3: Terminal using parallelism</li>
            </ul>
        </div>
    );
}

export default Projects;
